import React, { useState, useEffect } from "react";
import axios from "axios";

const Dashboard = () => {
  const [lovSalesSeasons, setlovSalesSeasons] = useState([]);
  const [error, setError] = useState("");
  const [lovSalesSeasonSearchTerm, setlovSalesSeasonSearchTerm] = useState("");
  const [statusSearchTerm, setStatusSearchTerm] = useState("");

  // useEffect(() => {
  //   fetchlovSalesSeasons();
  // }, []);

  // const fetchlovSalesSeasons = async () => {
  //   try {
  //     const response = await axios.get("http://localhost:5001/api/lovSalesSeasons");
  //     setlovSalesSeasons(response.data);
  //   } catch (error) {
  //     console.error("Error fetching data:", error);
  //     setError("Failed to load data. Please try again later.");
  //   }
  // };
const numberFormatter = new Intl.NumberFormat("en-US", {
  minimumFractionDigits: 0,
  maximumFractionDigits: 0,
});

const formatNumber = (value) =>
  typeof value === "number" ? numberFormatter.format(value) : "-";

const twoDecimalFormatter = new Intl.NumberFormat("en-US", {
  minimumFractionDigits: 2,
  maximumFractionDigits: 2,
});

const totalExportedFCL = lovSalesSeasons.reduce(
  (sum, item) => sum + (item.dsph_fcl || 0),
  0
);

const formattedTotalExportedFCL = formatNumber(totalExportedFCL);


useEffect(() => {
  fetch("http://10.13.10.12:5001/api/lovSalesSeasons")
    .then((res) => res.json())
    .then((data) => {
      console.log("📥 Received from API:", data);
      setlovSalesSeasons(data);
    })
    .catch((err) => {
      console.error("❌ Fetch error:", err);
      setError("Error fetching data");
    });
}, []);

  return (
    <div>
      <h1>Dashboard</h1>

      {/* lovSalesSeasons */}
      <div className="kpis">
        {/* {lovSalesSeasons.map((kpi) => (
          <div className="kpi" key={kpi._id}>
            <h1>{kpi.value}</h1>
            <p>{kpi.name}</p>
          </div>
        ))} */}
        <div className="kpi">
          <h1>{formattedTotalExportedFCL}</h1>
          <p>Exported (FCL)</p>
        </div>
        <div className="kpi">
          <h1>60,000,000</h1>
          <p>Production Cost (USD)</p>
        </div>
        <div className="kpi">
          <h1>80,000,000</h1>
          <p>FOB Sales (USD)</p>
        </div>
        <div className="kpi">
          <h1>10,000</h1>
          <p>Avg Margin per FCL</p>
        </div>
      </div>

      {/* Summary table */}
      <div className="lovSalesSeasons-list">
        <h3>Seasons</h3>

        {error && <div className="error-message">{error}</div>}
        <div className="table-container">
          <table>
            <thead>
              <tr>
                {/* <th>
                  <div className="table-header">
                    Season
                    <input
                      type="text"
                      placeholder="Search by Season"
                      value={lovSalesSeasonSearchTerm}
                      onChange={(e) => setlovSalesSeasonSearchTerm(e.target.value)}
                      className="Search-input"
                    />
                  </div>
                </th> */}
                <th>Season</th>
                <th>Crop</th>
                <th className="number-cell">Exported (FCL)</th>
                <th className="number-cell">Exported (Eq.Boxes)</th>
                <th className="number-cell">Freight.Cost (USD)</th>
                <th className="number-cell">Inv.FOB.Sales (USD)</th>
                <th className="number-cell">Adj.CFR.Sales (USD)</th>
                <th className="number-cell">
                  Adj.CFR.Sales (USD/FCL)&nbsp;
                  <span
                    title="Adjusted CFR Sales divided by Exported FCLXxxxxxxxjndfoweofarieurliaurflairufnalirualerigvbaleirgubelirbvleibvelivb"
                    style={{ cursor: "help", color: "#888" }}
                  >
                    ⓘ
                  </span>
                </th>                
                {/* <th>
                  <div className="table-header">
                    Status
                    <input
                      type="text"
                      placeholder="Search by Status"
                      value={statusSearchTerm}
                      onChange={(e) => setStatusSearchTerm(e.target.value)}
                      className="Search-input"
                    />
                  </div>
                </th> */}
              </tr>
            </thead>
            <tbody>
              {lovSalesSeasons
                // .filter(
                //   (season) =>
                //     season.name
                //       .toLowerCase()
                //       .includes(lovSalesSeasonSearchTerm.toLowerCase()) 
                    // &&
                    // kpi.value
                    //   .toLowerCase()
                    //   .includes(statusSearchTerm.toLowerCase())
                // )
                .sort((a, b) => a.season_prod.localeCompare(b.season_prod)) // ascending
                .map((season) => (
                  <tr key={season.season_prod}>
                    <td>{season.season_prod}</td>
                    <td>{season.crop}</td>
                    <td className="number-cell">{formatNumber(season.dsph_fcl)}</td>
                    <td className="number-cell">{formatNumber(season.dsph_eqbx)}</td>
                    <td className="number-cell">{formatNumber(season.sls_frt_usd)}</td>
                    <td className="number-cell">{formatNumber(season.sls_fob_usd)}</td>
                    <td className="number-cell">{formatNumber(season.tot_sls_usd)}</td>
                    <td className="number-cell">
                      {season.dsph_fcl > 0
                        ? twoDecimalFormatter.format(season.tot_sls_usd / season.dsph_fcl)
                        : "-"}
                    </td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
